GameData["ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[Elite squad chosen from the Xanthite kabal, these cultists can be anything but harmless]]
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[By conjuring various incantations they are able to get rid of ranged enemy attackers with ease]]
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[Also, with the use of stronger spells, even the strongest foes can meet their end]]
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[That comes at a price, though, the life of many cultists is partially consumed in order to release such sudden and intense bursts of psichic energy.]]
